syntax = "proto3";
option csharp_namespace = "Common.Protobuf";

option java_package = "catgirl.kirara.moe";

import "Vector.proto";

// Name: EHEKHEAHJJN
message TreasureMapDetectorData {
    uint32 radius = 1;
    uint32 region_id = 2;
    bool is_region_detected = 3;
    Vector center_pos = 13;
    repeated Vector spot_list = 9;
}

